import React, { useState } from 'react';n

const DoctorForm = () => {
    // State variables to hold form data
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phone, setPhone] = useState('');
    const [email, setEmail] = useState('');
    const [address, setAddress] = useState('');
    const [locality, setLocality] = useState('');
    const [age, setAge] = useState('');
    const [gender, setGender] = useState('');
    const [nationality, setNationality] = useState('');
    const [dob, setDob] = useState('');
    const [education, setEducation] = useState('');
    const [higherQualification, setHigherQualification] = useState('');

    // Function to handle form submission
    const handleSubmit = (event) => {
        event.preventDefault();
        // Process form data (you can add validation here)
        // For now, let's log the form data
        console.log({
            firstName,
            lastName,
            phone,
            email,
            address,
            locality,
            age,
            gender,
            nationality,
            dob,
            education,
            higherQualification
        });
        // Reset form fields (if needed)
        // setFirstName('');
        // setLastName('');
        // ...
    };

    return (
        <div className="main">
            <div className="icon">
                <h2 className="logo">Care&Cure</h2>
            </div>

            <header><b><h5>Doctor Registration Form</h5></b></header>

            <div className="container" style={{ marginLeft: '10%', marginTop: '5%' }}>
                <div className="main-container" style={{ display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap', gap: '1rem' }}>
                    <div className="inner-container" style={{ justifyContent: 'space-between', display: 'flex', flexWrap: 'wrap', gap: '10rem' }}>
                        <input type="text" placeholder="    *First Name" value={firstName} onChange={(e) => setFirstName(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Last Name" value={lastName} onChange={(e) => setLastName(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Phone/Mobile" value={phone} onChange={(e) => setPhone(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                    </div>

                    <div className="inner-container" style={{ justifyContent: 'space-between', display: 'flex', flexWrap: 'wrap', gap: '10rem', marginTop: '6%' }}>
                        <input type="email" placeholder="    *Email-id" value={email} onChange={(e) => setEmail(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Permanent Address" value={address} onChange={(e) => setAddress(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="email" placeholder="    *Locality" value={locality} onChange={(e) => setLocality(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                    </div>

                    <div className="inner-container" style={{ justifyContent: 'space-between', display: 'flex', flexWrap: 'wrap', gap: '10rem', marginTop: '6%' }}>
                        <input type="text" placeholder="    *Age" value={age} onChange={(e) => setAge(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Gender" value={gender} onChange={(e) => setGender(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Nationality" value={nationality} onChange={(e) => setNationality(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                    </div>

                    <div className="inner-container" style={{ justifyContent: 'space-between', display: 'flex', flexWrap: 'wrap', gap: '10rem', marginTop: '6%' }}>
                        <input type="text" placeholder="    *Date-of-Birth(dd/mm/yy)" value={dob} onChange={(e) => setDob(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Educational Qualification" value={education} onChange={(e) => setEducation(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                        <input type="text" placeholder="    *Higher Qualification" value={higherQualification} onChange={(e) => setHigherQualification(e.target.value)} style={{ borderRadius: '8px', width: '250px', height: '250%', borderColor: 'white', borderStyle: 'double' }} />
                    </div>
                </div>

                <br /><br /><br /><br />

                <button className="but" style={{ width: '100px', height: '40px', marginLeft: '480px', borderColor: 'antiquewhite', borderRadius: '5px', fontSize: '50px' }} onClick={handleSubmit}><a style={{ fontSize: '16px' }}>Submit</a></button>
            </div>
        </div>
    );
};

export default DoctorForm;
